/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `team_record_after_insert` AFTER INSERT ON `game` FOR EACH ROW BEGIN
	declare wins_var int;
    declare losses_var int;
    
    IF ((new.home_score - new.away_score) > 0) THEN
		SELECT wins into wins_var FROM teams WHERE team_name = new.home_team;
        SELECT losses into losses_var FROM teams WHERE team_name = new.away_team;
		UPDATE teams
			SET wins = wins_var + 1 WHERE team_name = new.home_team;
		UPDATE teams
			SET losses = losses_var + 1 WHERE team_name = new.away_team;
	ELSEIF ((new.home_score - new.away_score) < 0) THEN
		SELECT wins into wins_var FROM teams WHERE team_name = new.away_team;
        SELECT losses into losses_var FROM teams WHERE team_name = new.home_team;
		UPDATE teams
			SET wins = wins_var + 1 WHERE team_name = new.away_team;
		UPDATE teams
			SET losses = losses_var + 1 WHERE team_name = new.home_team;
	END IF;
    
END */;;
