							pts_p INT, assts_p INT, rebs_p INT, blks_p INT, stls_p INT)
BEGIN
    
    declare player_id_var INT;
    
	IF (SELECT count(player_id) FROM player WHERE player_name = player_name_p) = 0 THEN
    		INSERT INTO player (player_name, team_name, avg_mins, avg_pts, avg_assts, avg_rebs, avg_blks, avg_stls)
			VALUES (player_name_p, team_name_p, mins_p, pts_p, assts_p, rebs_p, blks_p, stls_p);
	ELSE
		SELECT player_id into player_id_var FROM player WHERE player_name = player_name_p AND team_name = team_name_p;
		
        UPDATE player
			set avg_mins = (SELECT DISTINCT round(((sum(mins) + mins_p) / (count(game_id) + 1)), 2) FROM box_score 
							WHERE player_id = player_id_var GROUP BY player_id),
